D.b04=new B.n("The TextBox control lets a user type text into an app. It's typically used to capture a single line of text, but can be configured to capture multiple lines of text. The text displays on the screen in a simple, uniform, plaintext format.\n\nTextBox has a number of features that can simplify text entry. It comes with a familiar, built-in context menu with support for copying and pasting text. It also has spell checking capabilities built in and enabled by default.",null,null,null,null,null,null,null,null,null,null)
